window.bookSummaryJSON = "<p>Easytown is the city of a thousand stories; tales of betrayed trusts, tarnished virtues, easily obtained vices, and street justice are common.</p> <p>Treat yourself to a glimpse into the dark future world of New Orleans, where humanity's base desires have overshadowed common decency, and very few are willing to stand in the way. With 10 stories by seven well-known independent authors,<i> High Tech/Low Life </i>is guaranteed to please.</p> <p>It's a gritty world, full of murky choices where the line between good and evil is smeared with blood. Welcome to Easytown.</p> <p>With stories by Martin Allen, Chris Philbrook, Valerie Lioudis, Joseph Hansen, C.T. Phipps, J.B. Havens, and Brian Parker.</p>"; 
